import { useEffect, useState } from "react";
import { useDispatch } from "react-redux";
import { registerUser } from "../redux/Actions/registerActions";
import { useNavigate } from "react-router-dom";

export function Register() {
  const [enteredfirst, setFirstName] = useState("");
  const [enteredlast, setLastName] = useState("");
  const [enteredEmail, setEmail] = useState("");
  const [enteredPassword, setPassword] = useState("");

  const dispatch = useDispatch();

  function authenticate() {
    console.log(enteredfirst, enteredlast, enteredEmail, enteredPassword);
    dispatch(
      registerUser(enteredfirst, enteredlast, enteredEmail, enteredPassword)
    );
    alert("Registration Successful");
  }

  useEffect(() => {
    //directed to home page
    navigate("/");
  }, []);
  return (
    <div className="Register">
      <div className="Register-Container">
        <form onSubmit={authenticate}>
          <h2>Enter Registration Details</h2>
          <br />

          <input
            className="Input"
            type="text"
            id="fname"
            placeholder="first name"
            value={enteredfirst}
            onChange={(e) => setFirstName(e.target.value)}
          />
          <input
            className="Input"
            type="text"
            id="lnumber"
            placeholder="last name"
            value={enteredlast}
            onChange={(e) => setLastName(e.target.value)}
          />
          <input
            className="Input"
            type="text"
            id="email"
            placeholder="email"
            value={enteredEmail}
            onChange={(e) => setEmail(e.target.value)}
          />
          <input
            className="Input"
            type="password"
            id="password"
            placeholder="password"
            value={enteredPassword}
            onChange={(e) => setPassword(e.target.value)}
          />
        </form>

        <br />

        <br />

        <button className="Button" onClick={() => navigate("/login")}>
          Login
        </button>
        <button className="Button" onClick={() => navigate("/")}>
          Home
        </button>
        <button className="Button" onClick={authenticate}>
          Register
        </button>
      </div>
    </div>
  );
}
